import 'rsuite/dist/styles/rsuite-default.css';
import React, { ReactNode } from 'react';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import CssBaseline from '@material-ui/core/CssBaseline';
import { makeStyles } from '@material-ui/core/styles';
import config from './components/config/defaultblueprint.json'
import clsx from  'clsx';
import SocialIcon2 from './components/SocialIcon2'


export type ContainerVprops = {
  classes?:	object;
  className?:string;
  component?: Element;
  disableGutters?: boolean;
  fixed?:	boolean;
  maxWidth?: string;
   children?: any;
};

export type GridVprops ={
alignContent?:string;
alignItems?:string;
children?:	ReactNode;
className?:string;
classes?:	object;
 component?: Element;
container?:	boolean;
direction?:string;
item?:boolean;
justify?:string;
wrap?:string;
spacing?:number;
xl?:boolean|string|number;
xs?:boolean|string|number;
md?:boolean|string|number;
lg?:boolean|string|number;
sm?:boolean|string|number;
zeroMinWidth?:	boolean;
}


export const ContainerV = (props: ContainerVprops) => {
  const _containerprops = {...props};
  return <Container {..._containerprops}>{props.children}</Container>;
};

export const GridV = (props: GridVprops ) => {
  const _gridVprops  = {...props};
  return <Grid {..._gridVprops}>{props.children}</Grid>;
};


const useStyles = makeStyles((theme) => ({
  root: {
     backgroundColor: config.companyInfo.containerBackgroundColor,
     color: config.companyInfo.textColor,
     margin:'10px auto',
     height: '200px'
  },
  paper: {
    textAlign: 'center',
    width: '25%',
    height: '125px',
    display:'flex',
    fontWeight:'lighter',
    fontSize:'12px',
  },
  leftBorderHeader: {
    padding: '0px 10px',
    borderLeft: '1px solid ',
    borderColor: config.companyInfo.borderColor,
  },

 logoMargin:{
    margin:'0px 15px'
 },
 copyRight:{
   display:'flex',
   fontSize:'10px'
 }
}));

const address=[
  {
    address:"vlinder Labs Pvt. Ltd. TERRACE FLOOR, 837, 11TH CROSS, 26th Main Rd, 1st Sector, HSR Layout, Bengaluru, Karnataka 560102",
  }
]

array.forEach(element => {
  
});

 function FooterV(){

     const classes = useStyles();

  return (

    <React.Fragment>

      <CssBaseline />
      <ContainerV maxWidth="lg" className={classes.root} >
        <GridV container spacing={0}  >
        <GridV item lg={3} justify="center" alignItems="center" className={classes.paper}>
                <a href={config.companyInfo.companyLink}><img src={config.companyInfo.logoSrc} alt={config.companyInfo.logoAlt} /></a>
        </GridV>
       <GridV item lg={3} justify="center" alignItems="center" className={clsx(classes.paper,classes.leftBorderHeader)} >
            {config.companyInfo.address}
        </GridV>
        <GridV item lg={3}  justify="center" alignItems="center"  className={clsx(classes.paper,classes.leftBorderHeader)}>
            {config.companyInfo.email}
          <br/>
            {config.companyInfo.contactNumber}
        </GridV>

        <GridV item lg={3} alignContent="flex-center" justify="center" alignItems="center" className={clsx(classes.paper,classes.leftBorderHeader)}>
          <SocialIcon2 />

        </GridV>

      </GridV>
      <hr/>
      <GridV item lg={12} justify="center" alignItems="center" className={classes.copyRight}>
          <h6>{config.companyInfo.copyright} <a href={config.companyInfo.companyLink}>{config.companyInfo.companyName}</a></h6>
       </GridV>
      </ContainerV>

    </React.Fragment>
  );
}
export default FooterV;
